// src/components/setupReview.js
import React, { useEffect, useState } from 'react';
import { getSetupLog } from '../alerts/setupLogger';
import { getSessionTag } from '../alerts/tagGenerator';

const SetupReview = ({ filterDashboard }) => {
  const [setups, setSetups] = useState([]);

  useEffect(() => {
    const log = getSetupLog();
    const filtered = filterDashboard
      ? log.filter((s) => s.dashboard === filterDashboard)
      : log;
    setSetups(filtered);
  }, [filterDashboard]);

  return (
    <div style={{ padding: '1rem', border: '1px solid #ccc' }}>
      <h4>üìù Setup Review</h4>
      {setups.length === 0 ? (
        <p style={{ color: '#888' }}>
          This placeholder will eventually show ICC setup reviews, tags, and notes.
        </p>
      ) : (
        <ul>
          {setups.map((setup, index) => (
            <li key={index} style={{ marginBottom: '1rem' }}>
              <strong>{setup.symbol}</strong> ‚Äî {setup.timeframe} ‚Äî {getSessionTag(setup.timestamp)}
              <br />
              <span style={{ fontSize: '0.9rem', color: '#aaa' }}>
                {new Date(setup.timestamp).toLocaleString()}
              </span>
              <br />
              <span>üè∑Ô∏è ICC Tags: {setup.iccTags.join(', ')}</span>
              <br />
              <span>üìå Outcome: {setup.outcome || 'Pending'}</span>
              <br />
              <span>üóíÔ∏è Notes: <em>Auto-generated setup ‚Äî no manual notes</em></span>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default SetupReview;
